// Header.js
import React from 'react';

const Header = () => {
  return (
    <div>
        <div class="logo-group" style={{display: "flex", flexDirection: "row", height: "74px", paddingLeft: "24px", paddingRight: "24px", borderRadius: "5px"}}>
			<img src="/assets/images/logo_main.png" alt="Phishducation logo"></img>
		</div>
    </div>
  );
};

export default Header;
